Club Classics Vol. One is the debut album by the British group Soul II Soul. Released in
1989, the album featured the group's hit singles &quot;Keep on Movin'&quot; and &quot;Back to Life [However
Do You Want Me]&quot;, which was a UK number one and the fifth best~selling single in the UK
that year. The album also reached number one and was certified 3 x Platinum by the British
Phonographic Industry for sales in excess of 900,000 copies.

In the United States [where it was renamed as Keep On Movin'], the album reached the Top
20 and was certified 2 x Platinum by the RIAA for sales in excess of 2 million copies. The
single &quot;Back To Life&quot; was also a Top 10 hit in the US and was certified Platinum.

Like many other dance albums recorded around that time, such as Black Box's Dreamland,
other songs from the album became club hits despite not being released as singles [e.g. ~
&quot;Holdin' On&quot;].

In 2000, Q magazine placed Club Classics Vol. One at number 49 in its list of the 100
Greatest British Albums Ever.In 2006, the magazine placed the album at
number 34 in its list of &quot;40 Best Albums of the 1980s&quot;.

In October 2004, the track &quot;Keep on Movin'&quot; appeared in popular videogame Grand Theft
Auto: San Andreas, playing on fictional New Jack Swing radio station CSR 103.9


